//UNIT TEST FOR BUG 4 - isGameOver Supply Count#include "dominion.h"#include "dominion_helpers.h"#include "rngs.h"#include <stdio.h>#include <math.h>#include <stdlib.h>#include <time.h>#include <string.h>int main() {    //INITIALIZE NECESSARY INDEXES AND GAME VARIABLES    int i;    int k[10] = {adventurer, council_room, feast, gardens, mine, remodel, smithy, village, sea_hag, treasure_map};    srand(time(NULL));    //INITIALIZE GAME    struct gameState G;    int players = rand()%3 + 2;    memset(&G, 23, sizeof(struct gameState)); //SET GAME STATE    int r = initializeGame(players, k, 12, &G); //BEGIN NEW GAME WITH 2-5 PLAYERS    if (r != 0) {        printf("ERROR: Could not initialize game. Returned error code %d\n", r);        return r;    }    printf("Testing Bug 4: isGameOverSupplyCount\n");    //SET UP PLAYER'S HAND    G.whoseTurn = 0;    G.handCount[0] = 5;    G.hand[0][0] = rand()% 27;    G.hand[0][1] = rand()% 27;    G.hand[0][2] = rand()% 27;    G.hand[0][3] = rand()% 27;    G.hand[0][4] = rand()% 27;    //EMPTY THE sea_hag (26) SUPPLY PILE    int total = supplyCount(sea_hag, &G);    printf("total sea_hag = %d\n", total);    for (i = 0; i < total; i++)        gainCard(sea_hag, &G, 1, 0);    total = supplyCount(sea_hag, &G);    printf("total sea_hag = %d\n", total);    //EMPTY THE treasure_map (27) SUPPLY PILE    total = supplyCount(treasure_map, &G);    printf("total treasure_map = %d\n", total);    for (i = 0; i < total; i++)        gainCard(treasure_map, &G, 1, 0);    total = supplyCount(treasure_map, &G);    printf("total treasure_map = %d\n", total);    //EMPTY THE smithy (13) SUPPLY PILE    total = supplyCount(smithy, &G);    printf("total smithy = %d\n", total);    for (i = 0; i < total; i++)        gainCard(smithy, &G, 1, 0);    total = supplyCount(smithy, &G);    printf("total smithy = %d\n", total);    //TEST IF GAME IS OVER    r = isGameOver(&G);    if (r == 0)        printf("ERROR: Game is not over. Returned code %d\n", r);    return 0;}